reviewContent:
저는 보석 십자수하면서 비즈가 색별로 너무 예뻐서 여러 작품을 삿엇는데&hellip;
이번꺼는 실망이 커서 남깁니다.
색이 일정치 않고 오염되잇는 비즈가 너무 많아서 빼고 작업햇음에도 불구하고 작품이 지저분해보이네요&hellip;제가 받은 상품만 이런건지..
다른상품 받앗을때는 안이랫는데 똑같이 돈 주고 산 입장에서 기분이 좋지 않습니다..
답변 부탁드릴께요&hellip;

재밌어요^^
쬐끔씩 불량있는걸 무시하고 붙였다가 자꾸 눈에 걸리적거려서 다시 떼게되네요;;
첨부터 양품으로 이쁘게 붙이세요ㅋ

딸아이 선물로 구매했어요.
그냥 종이는 말린다고해서 캔버스형으로 주문했는데
만족합니다~ 딸아이가 빨리 끝내고 방에 걸어논다고 열심히 하네요^^;

재밌습니다. 하고나서 완성품이 기대되기도 하구요.
그런데 도안이 잘못오기도 했고, 제품에 조금 긁힌 자국도 있어서 조금 아쉽습니다..^^;;
그래도 다행히 잘못된 도안이나 손상된 제품에 대한 상담은 충분히 해 주셨습니다. 고맙습니다.
